a124010_row 1 = [0]
a124010_row n = f n primes where
   f 1 _      = []
   f u (p:ps) = h u 0 where
     h v e
      | (v',m) <- divMod v p
      , m == 0 = h v' (e + 1)
      | e  > 0 = e : f v ps
      | let    = f v ps

instance OEIS 20639 where
